// src/AppRoutes.jsx
import React, { lazy, Suspense } from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import { useAuth } from './context/AuthContext';
import Layout from './components/Layout';
import LoadingScreen from './components/LoadingScreen';
import ProtectedRoute from './components/ProtectedRoute';
import RoleBasedRoute from './components/RoleBasedRoute';

// üî• Lazy Loading ŸÑŸÑÿµŸÅÿ≠ÿßÿ™ ŸÑÿ™ÿ≠ÿ≥ŸäŸÜ ÿßŸÑÿ£ÿØÿßÿ°
const Login = lazy(() => import('./pages/Login'));
const Unauthorized = lazy(() => import('./pages/Unauthorized'));
const NotFound = lazy(() => import('./pages/NotFound'));

// ÿµŸÅÿ≠ÿßÿ™ ÿßŸÑŸÖÿØŸäÿ± - Lazy Loading
const AdminDashboard = lazy(() => import('./pages/admin/Dashboard'));
const UsersManagement = lazy(() => import('./pages/admin/UsersManagement'));
const BranchesManagement = lazy(() => import('./pages/admin/BranchesManagement'));
const GamesManagement = lazy(() => import('./pages/admin/GamesManagement'));
const RentalsManagement = lazy(() => import('./pages/admin/RentalsManagement'));
const RentalsRevenueAnalysis = lazy(() => import('./pages/admin/RentalsRevenueAnalysis'));
const Settings = lazy(() => import('./pages/admin/Settings'));
const ShiftsManagement = lazy(() => import('./pages/admin/ShiftsManagement'));
const Reports = lazy(() => import('./pages/admin/Reports'));
const Customers = lazy(() => import('./pages/admin/Customers'));

// ÿµŸÅÿ≠ÿßÿ™ ÿßŸÑŸÖŸàÿ∏ŸÅ - Lazy Loading
const EmployeeDashboard = lazy(() => import('./pages/employee/Dashboard'));
const Rentals = lazy(() => import('./pages/employee/Rentals'));
const ActiveRentals = lazy(() => import('./pages/employee/ActiveRentals'));
const StartShift = lazy(() => import('./pages/employee/StartShift'));
const ShiftHistory = lazy(() => import('./pages/employee/ShiftHistory'));

// üî• ŸÖŸÉŸàŸÜ ŸÑŸÑÿ™ÿ≠ŸÖŸäŸÑ ÿ£ÿ´ŸÜÿßÿ° ÿßŸÑÿ™ÿ≠ŸÖŸäŸÑ ÿßŸÑÿ®ÿ∑Ÿäÿ°
const RouteLoader = ({ children }) => (
  <Suspense fallback={<LoadingScreen />}>
    {children}
  </Suspense>
);

// üî• ÿØÿßŸÑÿ© ŸÑÿ•ŸÜÿ¥ÿßÿ° ŸÖÿ≥ÿßÿ±ÿßÿ™ ŸÖÿ¥ÿ™ÿ±ŸÉÿ©
const createAdminRoutes = () => (
  <RouteLoader>
    <Layout adminLayout>
      <Routes>
        <Route index element={<Navigate to="dashboard" replace />} />
        <Route path="dashboard" element={<AdminDashboard />} />
        <Route path="users" element={<UsersManagement />} />
        <Route path="branches" element={<BranchesManagement />} />
        <Route path="games" element={<GamesManagement />} />
        <Route path="rentals" element={<RentalsManagement />} />
        <Route path="rentals/completed" element={<RentalsManagement showCompleted />} />
        <Route path="rentals/active" element={<RentalsManagement showActive />} />
        <Route path="revenue-analysis" element={<RentalsRevenueAnalysis />} />
        <Route path="reports" element={<Reports />} />
        <Route path="reports/daily" element={<Reports type="daily" />} />
        <Route path="reports/monthly" element={<Reports type="monthly" />} />
        <Route path="reports/performance" element={<Reports type="performance" />} />
        <Route path="shifts" element={<ShiftsManagement />} />
        <Route path="customers" element={<Customers />} />
        <Route path="settings" element={<Settings />} />
        <Route path="settings/general" element={<Settings tab="general" />} />
        <Route path="settings/billing" element={<Settings tab="billing" />} />
        <Route path="settings/notifications" element={<Settings tab="notifications" />} />
      </Routes>
    </Layout>
  </RouteLoader>
);

const createEmployeeRoutes = () => (
  <RouteLoader>
    <Layout employeeLayout>
      <Routes>
        <Route index element={<Navigate to="dashboard" replace />} />
        <Route path="dashboard" element={<EmployeeDashboard />} />
        <Route path="rentals" element={<Rentals />} />
        <Route path="rentals/new" element={<Rentals mode="new" />} />
        <Route path="rentals/active" element={<ActiveRentals />} />
        <Route path="rentals/completed" element={<Rentals mode="completed" />} />
        <Route path="shift/start" element={<StartShift />} />
        <Route path="shift/history" element={<ShiftHistory />} />
        <Route path="shift/current" element={<Rentals showShiftInfo />} />
        <Route path="customers" element={<Customers employeeView />} />
        <Route path="profile" element={<div>ÿßŸÑŸÖŸÑŸÅ ÿßŸÑÿ¥ÿÆÿµŸä</div>} />
      </Routes>
    </Layout>
  </RouteLoader>
);

const AppRoutes = () => {
  const { user, loading } = useAuth();
  
  if (loading) {
    return <LoadingScreen message="ÿ¨ÿßÿ±Ÿä ÿßŸÑÿ™ÿ≠ŸÇŸÇ ŸÖŸÜ ÿßŸÑÿ¨ŸÑÿ≥ÿ©..." />;
  }
  
  return (
    <Routes>
      {/* üîê ÿµŸÅÿ≠ÿ© ÿ™ÿ≥ÿ¨ŸäŸÑ ÿßŸÑÿØÿÆŸàŸÑ */}
      <Route path="/login" element={
        <RouteLoader>
          <Login />
        </RouteLoader>
      } />
      
      {/* üîê ÿµŸÅÿ≠ÿ© ÿ∫Ÿäÿ± ŸÖÿµÿ±ÿ≠ */}
      <Route path="/unauthorized" element={
        <RouteLoader>
          <Unauthorized />
        </RouteLoader>
      } />
      
      {/* üè¢ ŸÖÿ≥ÿßÿ±ÿßÿ™ ÿßŸÑŸÖÿ¥ÿ±ŸÅ */}
      <Route path="/admin/*" element={
        <ProtectedRoute requiredRole="admin">
          {createAdminRoutes()}
        </ProtectedRoute>
      } />
      
      {/* üë§ ŸÖÿ≥ÿßÿ±ÿßÿ™ ÿßŸÑŸÖŸàÿ∏ŸÅ ŸàŸÖÿØŸäÿ± ÿßŸÑŸÅÿ±ÿπ */}
      <Route path="/employee/*" element={
        <ProtectedRoute allowedRoles={['employee', 'branch_manager']}>
          {createEmployeeRoutes()}
        </ProtectedRoute>
      } />
      
      {/* üîÑ ŸÖÿ≥ÿßÿ± ÿ∞ŸÉŸä ŸäÿπŸäÿØ ÿßŸÑÿ™Ÿàÿ¨ŸäŸá ÿ≠ÿ≥ÿ® ÿßŸÑÿØŸàÿ± */}
      <Route path="/" element={
        <RoleBasedRoute>
          {user?.role === 'admin' ? (
            <Navigate to="/admin/dashboard" replace />
          ) : (
            <Navigate to="/employee/dashboard" replace />
          )}
        </RoleBasedRoute>
      } />
      
      {/* üè† ÿßŸÑÿµŸÅÿ≠ÿ© ÿßŸÑÿ±ÿ¶Ÿäÿ≥Ÿäÿ© ÿßŸÑÿπÿßŸÖÿ© (ÿ•ÿ∞ÿß ŸÉÿßŸÜÿ™ ŸáŸÜÿßŸÉ) */}
      <Route path="/home" element={
        <div className="public-home">
          <h1>ŸÖÿ±ÿ≠ÿ®ÿßŸã ŸÅŸä ŸÜÿ∏ÿßŸÖ L3BTY ŸÑŸÑÿ™ÿ£ÿ¨Ÿäÿ±</h1>
          <p>ŸÖŸÜÿ∏ŸàŸÖÿ© ÿ•ÿØÿßÿ±ÿ© ÿ™ÿ£ÿ¨Ÿäÿ± ÿßŸÑÿ£ŸÑÿπÿßÿ® ÿßŸÑÿ•ŸÑŸÉÿ™ÿ±ŸàŸÜŸäÿ©</p>
        </div>
      } />
      
      {/* üìä ÿµŸÅÿ≠ÿ© ŸÑŸÑÿ•ÿ≠ÿµÿßÿ¶Ÿäÿßÿ™ ÿßŸÑÿπÿßŸÖÿ© (ÿπÿßŸÖÿ©) */}
      <Route path="/stats" element={
        <div className="public-stats">
          <h2>ÿ•ÿ≠ÿµÿßÿ¶Ÿäÿßÿ™ ÿßŸÑŸÜÿ∏ÿßŸÖ</h2>
          {/* ŸäŸÖŸÉŸÜ ÿ•ÿ∂ÿßŸÅÿ© ÿ•ÿ≠ÿµÿßÿ¶Ÿäÿßÿ™ ÿπÿßŸÖÿ© ŸáŸÜÿß */}
        </div>
      } />
      
      {/* ‚ùå ÿµŸÅÿ≠ÿ© 404 */}
      <Route path="*" element={
        <RouteLoader>
          <NotFound />
        </RouteLoader>
      } />
    </Routes>
  );
};

export default AppRoutes;
